import React from 'react';
import { NavLink } from 'react-router-dom';
import { FaBars } from 'react-icons/fa';

const Navigation = () => {

  return (
    <div className="sidebar">
      <NavLink exact to="/" activeClassName="navActive"></NavLink>
      <FaBars/>
    </div>
  );
};

export default Navigation;
